const Tasklist = (props) => {
    return (
        <React.Fragment key={props.indexkey}>

            {
                props.dateblock === props.tasklist.date ?
                    userdata.user_id === taskdata.user_id ?

                        <>


                            {(() => {
                                if (taskdata.time_seconds >= 41400000 && taskdata.time_seconds <= 45000000) {
                                    return (
                                        <td style={{ padding: '10px', textAlign: 'left' }}>{nl2br(taskdata.tasklist)}
                                        </td>
                                    )
                                } else {
                                    return (
                                        ""
                                    )
                                }

                            })()}
                            {(() => {
                                if (taskdata.time_seconds >= 52200000 && taskdata.time_seconds <= 55800000) {
                                    return (
                                        <td style={{ padding: '10px', textAlign: 'left' }}>{nl2br(taskdata.tasklist)}
                                        </td>
                                    )
                                } else {
                                    return (
                                        ""
                                    )
                                }

                            })()}

                            {(() => {
                                if (taskdata.time_seconds >= 63000000 && taskdata.time_seconds <= 66600000) {
                                    return (
                                        <td style={{ padding: '10px', textAlign: 'left' }}>{nl2br(taskdata.tasklist)}
                                        </td>
                                    )
                                } else {
                                    return (
                                        ""
                                    )
                                }

                            })()}


                        </> : "" : ""
            }
        </React.Fragment>
    )
}
export default Tasklist;
